            WriteLiteral(@"    <h3>A história</h3>
            <p>O projeto surgiu durante cumprimento de atividades práticas no curso do Recode Pro 2021, através do qual são formados desenvolvedores full-stack, fornecendo conhecimentos aos alunos para desenvolvimento de aplicações web.</p>
            <p>A partir de conversas com responsáveis por uma ONG que acolhe e auxilia refugiados no Brasil, foi constatada a carência de plataforma de divulgação de vagas de empregos voltadas aos refugiados. <br>
            Sendo assim, o Squad 22, um grupo que reúne seis dos alunos do projeto Recode Pro 2021, decidiu utilizar o conhecimento adquirido em sua participação no curso para desenvolver um projeto que disponibiliza uma plataforma de busca/divulgação de vagas de emprego, específicas para a população de refugiados atendidos pela <a href=""https://sjmrbrasil.org/"">ONG Serviço Jesuíta a Migrantes e Refugiados BRASIL (SJMR)</a>: o Wejobr.</p>
            
            <h3>O propósito</h3>
            <p>Conforme relatório fornecido pelo <");
            WriteLiteral(@"a href=""https://www.acnur.org/portugues/"">ACNUR</a> (Alto Comissariado das Nações Unidas para Refugiados), o tema Geração de Renda e Autossuficiência é a principal necessidade das pessoas refugiadas, apontada no formulário KoBo. Neste diagnóstico, foi identificada a oferta limitada de vagas de emprego aos refugiados, o que moveu a busca por uma ferramenta que auxilie a resolver este problema.</p>
            <p>O Wejobr consiste em um site que disponibiliza vagas de emprego nas mais diversas áreas, voltadas a contratação de pessoas refugiadas, proporcionando tanto a busca de vagas de emprego (pelos candidatos), assim com a busca de profissionais (para as empresas).</p>
            
